import './App.css';
import 'bootstrap/dist/css/bootstrap.css'
import { Navbar } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Navbar bg='navbar-config' variant='navbar-config'>
        <Navbar.Brand className='navbar-brand'>
          <img src='./assets/logo.png'></img>
        </Navbar.Brand>
      </Navbar>
    </div>
  );
}

export default App;
